// Copyright 2018 Stichting BlockMedx

pragma solidity ^0.4.24;

import "openzeppelin-solidity/contracts/token/ERC20/MintableToken.sol";
import "openzeppelin-solidity/contracts/token/ERC20/StandardBurnableToken.sol";
import "openzeppelin-solidity/contracts/token/ERC20/DetailedERC20.sol";

contract MDXToken is MintableToken, StandardBurnableToken, DetailedERC20 {

    function _mint(address beneficary, uint256 amount) internal {
        totalSupply_ = totalSupply_.add(amount);
        balances[beneficary] = balances[beneficary].add(amount);
        emit Mint(beneficary, amount);
        emit Transfer(address(0), beneficary, amount);
    }

    constructor() DetailedERC20("BlockMedx Token", "MDX", 18) public {

        // Initial Distribution

        // Private Sale
        _mint(0x2dbCdF86a85076EFbe66957EEa1fE9459C80e3Dc, 40000000 ether);

        // Foundation Address
        _mint(0xeA95d42B9dE15FB68E0185056C9B49bBa70cceAC, 48000000 ether);

        // Partnership Address
        _mint(0x4CEa486b33Be32E9D6b7364fb9a6e44826A776FC, 20999200 ether);

        // Team 1
        _mint(0xf5F228D6674fE4CbD70B0035728528C435417c38, 25250000 ether);

        // Team 2
        _mint(0xf76F3155f1f5b4e7a1B4Ea3A52DD08654E82f6f3, 4500000 ether);

        // Team 3
        _mint(0xDA03fF825Eb2306cbDdC85a40fD774cd8F5aB689, 75000 ether);

        // Team 4
        _mint(0xce689935c7B2f37B59e6399199C8Cd3f31f1A951, 25000 ether);

        // Team 5
        _mint(0xB76563d7707b2289714A2385377d606Da13e673e, 150000 ether);

        assert(totalSupply_ == 138999200 ether);

    }

}
